import { Box } from '@material-ui/core';

const Logo = (props) => (
         <Box
            alt="Logo Image"
            component="img"
            src="https://cdn.varsitymedialive.com/wp-content/uploads/2020/10/brand_logo.png"
            sx={{
              height: '130px'
            }}
          />
);

export default Logo;
